nge it compulsorily','2','2 km also charging 2400 and 12 km also the same.  the fee is very high,,,',NULL,'Staff switch over is having lot of effect on the eduction and minds of children.  Subject like maths and hindi  has to be revised...also other concerns of student has to be met..plz arrange mentor for the students among the staff and who take care of their academic and other problems.','4','','3','I am very much happy with subjects like hifz,arabic and islamic studies and other subjects she is struggling now compared to earlier.  need more practice and revision in the class.','3','good. needs lot of improvement','yes','yes','yes','yes','no',83,'2015-05-04 16:22:32','2015-05-04 16:22:32','SH. MOHAMED NOORULLAH','SH. ANAVAR ALAM',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
